import React from "react";
import { BrowserRouter as Router, Route, Link } from "react-router-dom";

const Sidebar = () => {
  return (
    <Router>
      <div>
        <Route>
          <Link to="/">Home</Link>
          <Link to="/about">About</Link>
          <Link to="/contacts">Contacts</Link>
          <Link to="/signup">Signup</Link>
        </Route>
      </div>
    </Router>
  );
};

export default Sidebar;
